It's good that we're aware of the issue, but that doesn't do you much good if you can't see what that issue is!
{{sticker:zombie-brand-mindblown}} 

From your client, it looks like your network is having a hard time grabbing any of the data it needs to display. It might be just a spotty connection, or there might be something blocking it, but let's check the most common issues by going through the steps in our [**connection faq**](https://support.riotgames.com/hc/en-us/articles/201752664-Troubleshooting-Connection-Issues). Hit me back up if you have questions!
